$(document).ready(function(){$(".carousel").carousel({interval:5000});$("#fillingPlaceTab a").click(function(d){d.preventDefault();$(this).tab("show")});var b;var a=new google.maps.LatLng(21.006345,105.84619);var c=new google.maps.LatLng(21.036862,105.774883);b=new google.maps.Map(document.getElementById("map-canvas"),{zoom:15,center:a,mapTypeId:google.maps.MapTypeId.ROADMAP});new google.maps.Marker({position:a,map:b,draggable:false,animation:google.maps.Animation.DROP});new google.maps.Marker({position:c,map:b,draggable:false,animation:google.maps.Animation.DROP});$("#fillingPlaceTab a").on("shown",function(g){var f=$(g.target).attr("href");var d;switch(f){case"#collaborator-viet-dung":d=a;break;case"#collaborator-vi-song":d=c;break;default:break}b.panTo(d)})});